import { Chart } from "react-google-charts";
let data = [
  ["Comment", "likes"],
  ["tanuja", 1245],
  ["shrre", 2362],
  ["ritesh", 1522],
  ["manas", 2950],
  ["palak", 1787],
];


 const options = {
  title: "most liked sensitional comment",
};

const ColumnChart = () => {
  return (


    <div class="col-sm-4"><Chart
      chartType="ColumnChart"
      data={data}
      options={options}
      width={"60%"}
      height={"400px"}
    /></div>

  )
}
export default ColumnChart;
